message:
Turbopack: don't emit unnecessary block (#79361)

This additional block was originally added to support cases like
```js
var {exports} = __turbopack_context;
{
  // user code
  var exports = 1234;
}
```
so we only need it if Turbopack actually inserts a variable declaration.

